import React, {useState, useEffect} from 'react';
import {
  Router,
  Route,
  Link,
} from 'react-router-dom';

const GoBack = ({title, content, path, color}) => {

  return (
    <Router>
      <Route path="/manager">
        <Link>
          <div className="goBack">
          <span class="material-icons">keyboard_backspace</span>
          </div>
        </Link>
      </Route>
    </Router>
  );
}

export default GoBack;
